/* Returns R, Rc, Patm */
void CKRP(int * ickwrk, double * restrict rckwrk, double * restrict ru, double * restrict ruc, double * restrict pa)
{
     *ru  = 8.31451e+07; 
     *ruc = 1.98721558317399615845; 
     *pa  = 1.01325e+06; 
}


/*Compute P = rhoRT/W(x) */
void CKPX(double * restrict rho, double * restrict T, double * restrict x, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double XW = 0;/* To hold mean molecular wt */
    XW += x[0]*28.013400; /*N2 */
    XW += x[1]*39.948000; /*AR */
    XW += x[2]*4.002600; /*HE */
    XW += x[3]*1.007970; /*H */
    XW += x[4]*31.998800; /*O2 */
    XW += x[5]*17.007370; /*OH */
    XW += x[6]*15.999400; /*O */
    XW += x[7]*2.015940; /*H2 */
    XW += x[8]*18.015340; /*H2O */
    XW += x[9]*33.006770; /*HO2 */
    XW += x[10]*34.014740; /*H2O2 */
    XW += x[11]*28.010550; /*CO */
    XW += x[12]*44.009950; /*CO2 */
    XW += x[13]*29.018520; /*HCO */
    XW += x[14]*30.026490; /*CH2O */
    XW += x[15]*16.043030; /*CH4 */
    XW += x[16]*15.035060; /*CH3 */
    XW += x[17]*14.027090; /*T-CH2 */
    XW += x[18]*14.027090; /*S-CH2 */
    XW += x[19]*28.054180; /*C2H4 */
    XW += x[20]*31.034460; /*CH3O */
    XW += x[21]*29.062150; /*C2H5 */
    XW += x[22]*30.070120; /*C2H6 */
    XW += x[23]*13.019120; /*CH */
    XW += x[24]*26.038240; /*C2H2 */
    XW += x[25]*27.046210; /*C2H3 */
    XW += x[26]*43.045610; /*CH2CHO */
    XW += x[27]*44.053580; /*C2H4O */
    XW += x[28]*42.037640; /*CH2CO */
    XW += x[29]*41.029670; /*HCCO */
    XW += x[30]*25.030270; /*C2H */
    XW += x[31]*31.034460; /*CH2OH */
    XW += x[32]*32.042430; /*CH3OH */
    XW += x[33]*46.069520; /*C2H5OH */
    XW += x[34]*44.053580; /*CH3CHO */
    XW += x[35]*45.061550; /*CH3CHOH */
    XW += x[36]*45.061550; /*CH2CH2OH */
    XW += x[37]*43.045610; /*CH3CO */
    XW += x[38]*45.061550; /*CH3CH2O */
    XW += x[39]*40.065330; /*C3H4 */
    XW += x[40]*39.057360; /*C3H3 */
    XW += x[41]*41.073300; /*C3H5 */
    XW += x[42]*42.081270; /*C3H6 */
    XW += x[43]*44.097210; /*C3H8 */
    XW += x[44]*43.089240; /*I-C3H7 */
    XW += x[45]*43.089240; /*N-C3H7 */
    *P = *rho * 8.31451e+07 * (*T) / XW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void CKPY(double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW = 0;/* for computing mean MW */
    YOW += y[0]*imw[0]; /*N2 */
    YOW += y[1]*imw[1]; /*AR */
    YOW += y[2]*imw[2]; /*HE */
    YOW += y[3]*imw[3]; /*H */
    YOW += y[4]*imw[4]; /*O2 */
    YOW += y[5]*imw[5]; /*OH */
    YOW += y[6]*imw[6]; /*O */
    YOW += y[7]*imw[7]; /*H2 */
    YOW += y[8]*imw[8]; /*H2O */
    YOW += y[9]*imw[9]; /*HO2 */
    YOW += y[10]*imw[10]; /*H2O2 */
    YOW += y[11]*imw[11]; /*CO */
    YOW += y[12]*imw[12]; /*CO2 */
    YOW += y[13]*imw[13]; /*HCO */
    YOW += y[14]*imw[14]; /*CH2O */
    YOW += y[15]*imw[15]; /*CH4 */
    YOW += y[16]*imw[16]; /*CH3 */
    YOW += y[17]*imw[17]; /*T-CH2 */
    YOW += y[18]*imw[18]; /*S-CH2 */
    YOW += y[19]*imw[19]; /*C2H4 */
    YOW += y[20]*imw[20]; /*CH3O */
    YOW += y[21]*imw[21]; /*C2H5 */
    YOW += y[22]*imw[22]; /*C2H6 */
    YOW += y[23]*imw[23]; /*CH */
    YOW += y[24]*imw[24]; /*C2H2 */
    YOW += y[25]*imw[25]; /*C2H3 */
    YOW += y[26]*imw[26]; /*CH2CHO */
    YOW += y[27]*imw[27]; /*C2H4O */
    YOW += y[28]*imw[28]; /*CH2CO */
    YOW += y[29]*imw[29]; /*HCCO */
    YOW += y[30]*imw[30]; /*C2H */
    YOW += y[31]*imw[31]; /*CH2OH */
    YOW += y[32]*imw[32]; /*CH3OH */
    YOW += y[33]*imw[33]; /*C2H5OH */
    YOW += y[34]*imw[34]; /*CH3CHO */
    YOW += y[35]*imw[35]; /*CH3CHOH */
    YOW += y[36]*imw[36]; /*CH2CH2OH */
    YOW += y[37]*imw[37]; /*CH3CO */
    YOW += y[38]*imw[38]; /*CH3CH2O */
    YOW += y[39]*imw[39]; /*C3H4 */
    YOW += y[40]*imw[40]; /*C3H3 */
    YOW += y[41]*imw[41]; /*C3H5 */
    YOW += y[42]*imw[42]; /*C3H6 */
    YOW += y[43]*imw[43]; /*C3H8 */
    YOW += y[44]*imw[44]; /*I-C3H7 */
    YOW += y[45]*imw[45]; /*N-C3H7 */
    *P = *rho * 8.31451e+07 * (*T) * YOW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void VCKPY(int * restrict np, double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW[*np];
    for (int i=0; i<(*np); i++) {
        YOW[i] = 0.0;
    }

    for (int n=0; n<46; n++) {
        for (int i=0; i<(*np); i++) {
            YOW[i] += y[n*(*np)+i] * imw[n];
        }
    }

    for (int i=0; i<(*np); i++) {
        P[i] = rho[i] * 8.31451e+07 * T[i] * YOW[i]; /*P = rho*R*T/W */
    }

    return;
}


