    W += c[19]*28.054180; /*C2H4 */
    W += c[20]*31.034460; /*CH3O */
    W += c[21]*29.062150; /*C2H5 */
    W += c[22]*30.070120; /*C2H6 */
    W += c[23]*13.019120; /*CH */
    W += c[24]*26.038240; /*C2H2 */
    W += c[25]*27.046210; /*C2H3 */
    W += c[26]*43.045610; /*CH2CHO */
    W += c[27]*44.053580; /*C2H4O */
    W += c[28]*42.037640; /*CH2CO */
    W += c[29]*41.029670; /*HCCO */
