    CW += c[8]*18.015340; /*H2O */
    CW += c[9]*33.006770; /*HO2 */
    CW += c[10]*34.014740; /*H2O2 */
    CW += c[11]*28.010550; /*CO */
    CW += c[12]*44.009950; /*CO2 */
