    CW += c[16]*15.035060; /*CH3 */
    CW += c[17]*14.027090; /*T-CH2 */
    CW += c[18]*14.027090; /*S-CH2 */
    CW += c[19]*28.054180; /*C2H4 */
    CW += c[20]*31.034460; /*CH3O */
    CW += c[21]*29.062150; /*C2H5 */
    CW += c[22]*30.070120; /*C2H6 */
    CW += c[23]*13.019120; /*CH */
    CW += c[24]*26.038240; /*C2H2 */
    CW += c[25]*27.046210; /*C2H3 */
    CW += c[26]*43.045610; /*CH2CHO */
    CW += c[27]*44.053580; /*C2H4O */
    CW += c[28]*42.037640; /*CH2CO */
    CW += c[29]*41.029670; /*HCCO */
    CW += c[30]*25.030270; /*C2H */
    CW += c[31]*31.034460; /*CH2OH */
    CW += c[32]*32.042430; /*CH3OH */
    CW += c[33]*46.069520; /*C2H5OH */
    CW += c[34]*44.053580; /*CH3CHO */
