/*Returns the molar production rate of species */
/*Given rho, T, and mass fractions */
void VCKWYR(int * restrict np, double * restrict rho, double * restrict T,
	    double * restrict y, int * restrict iwrk, double * restrict rwrk,
	    double * restrict wdot)
{
    double c[46*(*np)]; /*temporary storage */
    /*See Eq 8 with an extra 1e6 so c goes to SI */
    for (int n=0; n<46; n++) {
        for (int i=0; i<(*np); i++) {
            c[n*(*np)+i] = 1.0e6 * rho[i] * y[n*(*np)+i] * imw[n];
        }
    }

    /*call productionRate */
    vproductionRate(*np, wdot, c, T);

    /*convert to chemkin units */
    for (int i=0; i<46*(*np); i++) {
        wdot[i] *= 1.0e-6;
    }
}


/*Returns the molar production rate of species */
/*Given rho, T, and mole fractions */
void CKWXR(double * restrict rho, double * restrict T, double * restrict x, int * iwrk, double * restrict rwrk, double * restrict wdot)
{
    int id; /*loop counter */
    double c[46]; /*temporary storage */
    double XW = 0; /*See Eq 4, 11 in CK Manual */
    double ROW; 
    /*Compute mean molecular wt first */
    XW += x[0]*28.013400; /*N2 */
    XW += x[1]*39.948000; /*AR */
    XW += x[2]*4.002600; /*HE */
    XW += x[3]*1.007970; /*H */
    XW += x[4]*31.998800; /*O2 */
    XW += x[5]*17.007370; /*OH */
    XW += x[6]*15.999400; /*O */
    XW += x[7]*2.015940; /*H2 */
    XW += x[8]*18.015340; /*H2O */
    XW += x[9]*33.006770; /*HO2 */
    XW += x[10]*34.014740; /*H2O2 */
    XW += x[11]*28.010550; /*CO */
    XW += x[12]*44.009950; /*CO2 */
    XW += x[13]*29.018520; /*HCO */
    XW += x[14]*30.026490; /*CH2O */
    XW += x[15]*16.043030; /*CH4 */
    XW += x[16]*15.035060; /*CH3 */
    XW += x[17]*14.027090; /*T-CH2 */
    XW += x[18]*14.027090; /*S-CH2 */
    XW += x[19]*28.054180; /*C2H4 */
    XW += x[20]*31.034460; /*CH3O */
    XW += x[21]*29.062150; /*C2H5 */
    XW += x[22]*30.070120; /*C2H6 */
    XW += x[23]*13.019120; /*CH */
    XW += x[24]*26.038240; /*C2H2 */
    XW += x[25]*27.046210; /*C2H3 */
    XW += x[26]*43.045610; /*CH2CHO */
    XW += x[27]*44.053580; /*C2H4O */
    XW += x[28]*42.037640; /*CH2CO */
    XW += x[29]*41.029670; /*HCCO */
    XW += x[30]*25.030270; /*C2H */
    XW += x[31]*31.034460; /*CH2OH */
    XW += x[32]*32.042430; /*CH3OH */
    XW += x[33]*46.069520; /*C2H5OH */
    XW += x[34]*44.053580; /*CH3CHO */
    XW += x[35]*45.061550; /*CH3CHOH */
    XW += x[36]*45.061550; /*CH2CH2OH */
    XW += x[37]*43.045610; /*CH3CO */
    XW += x[38]*45.061550; /*CH3CH2O */
    XW += x[39]*40.065330; /*C3H4 */
    XW += x[40]*39.057360; /*C3H3 */
    XW += x[41]*41.073300; /*C3H5 */
    XW += x[42]*42.081270; /*C3H6 */
    XW += x[43]*44.097210; /*C3H8 */
    XW += x[44]*43.089240; /*I-C3H7 */
    XW += x[45]*43.089240; /*N-C3H7 */
    /*Extra 1e6 factor to take c to SI */
    ROW = 1e6*(*rho) / XW;

    /*Compute conversion, see Eq 11 */
    for (id = 0; id < 46; ++id) {
        c[id] = x[id]*ROW;
    }

    /*convert to chemkin units */
    productionRate(wdot, c, *T);

    /*convert to chemkin units */
    for (id = 0; id < 46; ++id) {
        wdot[id] *= 1.0e-6;
    }
}


/*Returns the rate of progress for each reaction */
void CKQC(double * restrict T, double * restrict C, int * iwrk, double * restrict rwrk, double * restrict qdot)
{
    int id; /*loop counter */

    /*convert to SI */
    for (id = 0; id < 46; ++id) {
        C[id] *= 1.0e6;
    }

    /*convert to chemkin units */
    progressRate(qdot, C, *T);

    /*convert to chemkin units */
    for (id = 0; id < 46; ++id) {
        C[id] *= 1.0e-6;
    }

    for (id = 0; id < 235; ++id) {
        qdot[id] *= 1.0e-6;
    }
}


