    eqcon[9] *= 1e-06; 

    /*reaction 11: C2H5OH (+M) <=> C2H4 + H2O (+M) */
    eqcon[10] *= 1e-06; 

    /*reaction 12: C3H3 + H (+M) <=> C3H4 (+M) */
