        Kc_s[67*npt+i] = exp((g_RT[4*npt+i] + g_RT[15*npt+i]) - (g_RT[9*npt+i] + g_RT[16*npt+i]));
        Kc_s[68*npt+i] = exp((g_RT[9*npt+i] + g_RT[15*npt+i]) - (g_RT[10*npt+i] + g_RT[16*npt+i]));
        Kc_s[69*npt+i] = exp((g_RT[3*npt+i] + g_RT[16*npt+i]) - (g_RT[7*npt+i] + g_RT[17*npt+i]));
        Kc_s[70*npt+i] = exp((g_RT[3*npt+i] + g_RT[16*npt+i]) - (g_RT[7*npt+i] + g_RT[18*npt+i]));
        Kc_s[71*npt+i] = exp((g_RT[5*npt+i] + g_RT[16*npt+i]) - (g_RT[8*npt+i] + g_RT[18*npt+i]));
        Kc_s[72*npt+i] = exp((g_RT[6*npt+i] + g_RT[16*npt+i]) - (g_RT[3*npt+i] + g_RT[14*npt+i]));
        Kc_s[73*npt+i] = exp((g_RT[16*npt+i] + g_RT[17*npt+i]) - (g_RT[3*npt+i] + g_RT[19*npt+i]));
        Kc_s[74*npt+i] = exp((g_RT[9*npt+i] + g_RT[16*npt+i]) - (g_RT[5*npt+i] + g_RT[20*npt+i]));
